import React, { useState, useEffect } from 'react';
import { ArrowLeft } from 'lucide-react';

const ResultsPage = () => {
  const [trafficData, setTrafficData] = useState(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [debugInfo, setDebugInfo] = useState(null);

  useEffect(() => {
    const searchParams = new URLSearchParams(window.location.search);
    const encodedName = searchParams.get('name');
    const encodedAddress = searchParams.get('address');

    // Decode the URL parameters
    const name = decodeURIComponent(encodedName);
    const address = decodeURIComponent(encodedAddress);

    const fetchTrafficData = async () => {
      setDebugInfo(null);
      try {
        const apiKey = 'pri_070565f833f9459aad223978a7a19b74';
        const besttimeUrl = `https://besttime.app/api/v1/forecasts?` + 
          new URLSearchParams({
            api_key_private: apiKey,
            venue_name: name,
            venue_address: address
          });

        setDebugInfo(prev => ({ ...prev, besttimeUrl, decodedName: name, decodedAddress: address }));

        const response = await fetch(besttimeUrl);
        const data = await response.json();

        setDebugInfo(prev => ({ ...prev, apiResponse: data }));

        if (data.status !== 'OK') {
          throw new Error(data.message || 'Failed to fetch forecast data');
        }

        setTrafficData(data);
      } catch (err) {
        setError(err.message || 'Failed to fetch traffic data. Please try again later.');
        console.error('API Error:', err);
      } finally {
        setLoading(false);
      }
    };

    if (encodedName && encodedAddress) {
      fetchTrafficData();
    } else {
      setError('No venue information provided.');
      setLoading(false);
    }
  }, []);

  const handleBackClick = () => {
    window.history.back();
  };

  const renderForecast = (forecast) => {
    if (!forecast || !forecast.analysis || !forecast.analysis.week_raw) {
      return <p>No forecast data available.</p>;
    }

    const daysOfWeek = ['Monday', 'Tuesday', 'Wednesday', 'Thursday', 'Friday', 'Saturday', 'Sunday'];

    return (
      <div>
        {forecast.analysis.week_raw.map((day, index) => (
          <div key={index} className="mb-4">
            <h3 className="font-semibold">{daysOfWeek[index]}</h3>
            <div className="flex flex-wrap">
              {day.day_raw.map((hour, hourIndex) => (
                <div key={hourIndex} className="w-1/6 p-1">
                  <div className="text-center p-2 bg-blue-100 rounded">
                    <div className="text-sm">{hourIndex}:00</div>
                    <div className="font-bold">{hour.intensity}%</div>
                  </div>
                </div>
              ))}
            </div>
          </div>
        ))}
      </div>
    );
  };

  return (
    <div className="min-h-screen bg-gray-100 p-8">
      <div className="max-w-4xl mx-auto">
        <button 
          onClick={handleBackClick}
          className="flex items-center text-blue-600 hover:text-blue-800 mb-6"
        >
          <ArrowLeft className="mr-2" size={20} />
          Back to Search
        </button>

        {loading && (
          <div className="text-center text-gray-600">
            Loading traffic data...
          </div>
        )}

        {error && (
          <div className="text-center text-red-500 mb-4">
            <p>Error: {error}</p>
            <p className="mt-2">The venue might not be in our database or there might be an issue with the API. Please try searching for a different venue.</p>
          </div>
        )}

        {trafficData && !loading && !error && (
          <div className="bg-white rounded-lg shadow-md p-6">
            <h1 className="text-2xl font-bold mb-4">{trafficData.venue_info.venue_name}</h1>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Address</h2>
              <p>{trafficData.venue_info.venue_address}</p>
            </div>
            <div className="mb-4">
              <h2 className="text-lg font-semibold mb-2">Foot Traffic Forecast</h2>
              {renderForecast(trafficData)}
            </div>
          </div>
        )}

        {debugInfo && (
          <div className="mt-8 bg-gray-200 p-4 rounded">
            <h2 className="text-lg font-semibold mb-2">Debug Information</h2>
            <pre className="whitespace-pre-wrap overflow-auto max-h-96">{JSON.stringify(debugInfo, null, 2)}</pre>
          </div>
        )}
      </div>
    </div>
  );
};

export default ResultsPage;
